import '../../App.css';

class Weather extends Component {
    state = {
        cities: [],
    };
    render() {
        return (

    <div className="City-container">
        <div className="Citys">
            <ul className="City-list">
                <li>Budva</li>
                <li>Podgorica</li>
                <li>Niksic</li>
                <li>Cetinje</li>
            </ul>
        </div>

        <div className="Day-container">
            <Day />
            <Day />
            <Day />
            <Day />
            <Day />
            <Day />
            <Day />

        </div>
    </div>



        );
    }
}

export default Weather;
